import React from 'react'

function navbar() {
  return (
    <div>
        <ul>
            <link to="/"><li>Home</li></link>
            <link to="/"><li>Dashbord</li></link>
            <link to="/"><li>About</li></link>

        </ul>
    </div>
  )
}

export default navbar;
